import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Container from '@material-ui/core/Container';
import Box from '@material-ui/core/Box';
import Typography from '@material-ui/core/Typography';
import AppleSignin from './../home/AppleSignIn';

const useStyles = makeStyles((theme) => ({
  primaryAction: {
    marginRight: theme.spacing(2),
    [theme.breakpoints.down('xs')]: {
      width: '100%',
      marginRight: theme.spacing(0),
      marginBottom: theme.spacing(2),
    }
  },
}));

export default function Header2(props) {

  const content = {
    'header': 'A New Way of Seeing Data',
    'description': 'iHeartRate allows you to see and interact with the data from you apple watch. \n With a single app you have the ability to view the data on a bigger screen.',
    'primary-action': 'Sign up for free',
    'secondary-action': 'Read more',
    ...props.content
  };

  return (
    <section>
      <Container maxWidth="md">
        <Box py={8} textAlign="center">
          <Typography variant="h3" component="h2" gutterBottom={true}>{content['header']}</Typography>
          <Typography variant="h5" color="textSecondary" paragraph={true}>{content['description']}</Typography>
          <Box mt={4}>
            <AppleSignin />
          </Box>
        </Box>
      </Container>
    </section>
  );
}
